import { FaPlus } from "react-icons/fa";

const AddItem = ( newItem, set) => {
  return (
    <form className='addForm'>
        <input 
        type="text" 
        placeholder="Add Item" 
        autoFocus
        id='addItem'
        required
        />

        <button 
            type="submit"
            aria-label='Add Item'
        >
            <FaPlus />
        </button>
    </form> 
  )
};

export default AddItem;
